void lv_example_img_1(void)
{
    LV_IMG_DECLARE(my_profile_img);
    lv_obj_t * img1 = lv_img_create(lv_scr_act());
    lv_img_set_src(img1, &my_profile_img);
    lv_obj_align(img1, LV_ALIGN_CENTER, 0, 0);
    lv_obj_set_size(img1, 120, 120);

    lv_obj_t * img2 = lv_img_create(lv_scr_act());
    lv_img_set_src(img2, LV_SYMBOL_HOME "SHUBHAM");
    lv_obj_align_to(img2, img1, LV_ALIGN_OUT_BOTTOM_MID, 0, 0);
}

/**********************
 * Display driver function to send pixels data
 **********************/
void my_display_send_pixels(int x1, int y1, int x2, int y2, lv_color_t *color_map)
{
    // 1. Set column address (X range)
    st7735_send_command(0x2A);
    st7735_send_data(x1 >> 8);
    st7735_send_data(x1 & 0xFF);
    st7735_send_data(x2 >> 8);
    st7735_send_data(x2 & 0xFF);

    // 2. Set row address (Y range)
    st7735_send_command(0x2B);
    st7735_send_data(y1 >> 8);
    st7735_send_data(y1 & 0xFF);
    st7735_send_data(y2 >> 8);
    st7735_send_data(y2 & 0xFF);

    // 3. Write to RAM
    st7735_send_command(0x2C);

    // 4. Send pixel data (RGB565 format)
    int total_pixels = (x2 - x1 + 1) * (y2 - y1 + 1);
    for (int i = 0; i < total_pixels; i++) {
        lv_color_t color = color_map[i];
        uint16_t color16 = color.full;  // Extract the raw 16-bit RGB565 value
        st7735_send_data(color16 >> 8); // High byte
        st7735_send_data(color16 & 0xFF); // Low byte
    }
}

/**********************
 * LVGL flush callback
 **********************/
static void st7735_flush_cb(lv_disp_drv_t *disp, const lv_area_t *area, lv_color_t *color_p)
{
    int32_t w = area->x2 - area->x1 + 1;
    int32_t h = area->y2 - area->y1 + 1;

    my_display_send_pixels(area->x1, area->y1, w, h, color_p);

    lv_disp_flush_ready(disp);  // Tell LVGL we're done
}

/**********************
 * LVGL Task to Updte/Refresh the display
 **********************/
void lvgl_task(void *pvParameter)
{
    while (1) {
        lv_timer_handler();   // LVGL tasks (animations, redraw)
        vTaskDelay(pdMS_TO_TICKS(10)); // Yield to avoid WDT reset
    }
}

void update_display() {
    st7735_send_command(0x2C);
    for (int i = 0; i < DISP_HOR_RES * DISP_VER_RES; i++) {
        st7735_send_data(frame_buffer[i] >> 8);
        st7735_send_data(frame_buffer[i] & 0xFF);
    }
}

