    lv_obj_set_style_radius(circle, LV_RADIUS_CIRCLE, LV_PART_MAIN);
    lv_obj_align(circle, LV_ALIGN_BOTTOM_RIGHT, -10, -10);
    
    // Create LVGL task
    xTaskCreate(lvgl_task, "lvgl_task", 4096*2, NULL, 1, NULL);

